stringLT:	#beq  $a0, $a1, $SLfalse
		lw   $t7, 0($a0)		#load string1's length
		lw   $t8, 0($a1)		#load string2's length
		bgt  $t7,$t8, $SL1		#if string1 is longer than string2 use string2's length else use string1's length
		move $t3, $t7			#use string1's length
		j $SL2
$SL1:		move $t3, $t8			#use string2's length
$SL2:		move $t4, $zero			#initialize counter to 0
		addi $t0, $a0, 4		#set t0 equal to the address of string1's first char
		addi $t1, $a1, 4		#set t1 equal to the address of string2's first char	
$SLloop:	bge  $t4, $t3, $SL3		#while loop:	check to for done  
		lw   $t5, 0($t0)
		lw   $t6, 0($t1)
		blt  $t5, $t6, $SLtrue		#if the current char from string2 < strin1's char then the function is true
		bgt  $t5, $t6, $SLfalse		#if the current char from string2 > strin1's char then the function is false
		addi $t0, $t0, 4		#goto next char in string1
		addi $t1, $t1, 4		#goto next char in string2
		addi $t4, $t4, 4		#increment counter
		j $SLloop			#return to the begining of the loop
$SL3:		blt $t7, $t8, $SLtrue		#check to see if string1 is less than string2
$SLfalse:	li $v0,	0			#return false
		j $SLend	
$SLtrue:	li $v0, 1			#return true
$SLend:		jr $ra	
	
stringGT:	#beq  $a0, $a1, $SGfalse
		lw   $t7, 0($a0)		#load string1's length
		lw   $t8, 0($a1)		#load string2's length
		bgt  $t7,$t8, $SG1		#if string1 is longer than string2 use string2's length else use string1's length
		move $t3, $t7			#use string1's length
		j    $SG2
$SG1:		move $t3, $t8			#use string2's length

$SG2:		move $t4, $zero			#initialize counter to 0
		addi $t0, $a0, 4		#set t0 equal to the address of string1's first char
		addi $t1, $a1, 4		#set t1 equal to the address of string2's first char	
$SGloop:	bge  $t4, $t3, $SG3		#while loop:	check to for done 
		lw   $t5, 0($t0)
		lw   $t6, 0($t1)
		blt  $t5, $t6, $SGfalse		#if the current char from string2 < strin1's char then the function is false
		bgt  $t5, $t6, $SGtrue		#if the current char from string2 > strin1's char then the function is true
		addi $t0, $t0, 4		#goto next char in string1
		addi $t1, $t1, 4		#goto next char in string2
		addi $t4, $t4, 4		#increment counter
		j    $SGloop			#return to the begining of the loop
$SG3:		bgt $t7, $t8, $SGtrue		#check to se if string1 is less than string2		 		
$SGfalse:	li   $v0, 0			#return false
		j    $SGend
$SGtrue:	li   $v0, 1			#return true
$SGend:		jr   $ra	


stringLE:	sw   $s0, -4($sp)
		sub  $sp, $sp, 8
		move $s0, $ra
		jal  stringGT
		seq  $v0, $v0, $zero
		move $ra, $s0
		lw   $s0, ($sp)
		addi $sp, $sp, 8
		jr   $ra

stringGE:	sw   $s0, -4($sp)
		sub  $sp, $sp, 8
		move $s0, $ra
		jal  stringLT
		seq  $v0, $v0, $zero
		move $ra, $s0
		lw   $s0, ($sp)
		addi $sp, $sp, 8
		jr   $ra
	
stringNEqual:	sw   $s0, -4($sp)
